description:
Mesa Redonda , no âmbito da Subcomissão do Tiro Esportivo, para debater a participação da mulher no tiro esportivo, em atenção ao Requerimento nº 55, de autoria do deputado Marcos Polllon.

Convidados confirmaados:
- Michelle Rocha Anechini Lara leite, advogada e atleta de tiro prático(presencial);

Aguardando confirmação:

-  Bruna Soares Mirandola, atleta de tiro prático;
- Catarina Fiorini Oeschsler, atleta de tiro prático;
- Cleide Aparecida Paris, empresária, fabricante de materiais esportivos, e
atleta de tiro;
- Edilaine Mansueto, Policial Militar do MS e instrutora de tiro;
- Juliana Marques Trovão Sacchi, instrurora de tiro e atleta;
- Cristiane Lemos Capistrano, atiradora esportiva e palestrante;
- Fabi venera, empresária e organizadora da Texas Expotiro.
